 * Sets or retrieves the state of the check box or radio button.
 */

form.comment:
/**
 * Retrieves a reference to the form that the object is embedded in.
 */

files.comment:
/**
 * Returns a FileList object on a file type input object.
 */

formAction.comment:
/**
 * Overrides the action attribute (where the data on a form is sent) on the parent form element.
 */

formEnctype.comment:
/**
 * Used to override the encoding (formEnctype attribute) specified on the form element.
 */

formMethod.comment:
/**
 * Overrides the submit method attribute previously specified on a form element.
 */

formNoValidate.comment:
/**
 * Overrides any validation or required attributes on a form or form elements to allow it to be submitted without validation. This can be used to create a "save draft"-type submit option.
 */

formTarget.comment:
/**
 * Overrides the target attribute on a form element.
 */

height.comment:
/**
 * Sets or retrieves the height of the object.
 */

list.comment:
/**
 * Specifies the ID of a pre-defined datalist of options for an input element.
 */

max.comment:
/**
 * Defines the maximum acceptable value for an input element with type="number".When used with the min and step attributes, lets you control the range and increment (such as only even numbers) that the user can enter into an input field.
 */

maxLength.comment:
/**
 * Sets or retrieves the maximum number of characters that the user can enter in a text control.
 */

min.comment:
/**
 * Defines the minimum acceptable value for an input element with type="number". When used with the max and step attributes, lets you control the range and increment (such as even numbers only) that the user can enter into an input field.
 */

multiple.comment:
/**
 * Sets or retrieves the Boolean value indicating whether multiple items can be selected from a list.
 */

name.comment:
/**
 * Sets or retrieves the name of the object.
 */

pattern.comment:
/**
 * Gets or sets a string containing a regular expression that the user's input must match.
 */

placeholder.comment:
/**
 * Gets or sets a text string that is displayed in an input field as a hint or prompt to users as the format or type of information they need to enter.The text appears in an input field until the user puts focus on the field.
 */

required.comment:
/**
 * When present, marks an element that can't be submitted without a value.
 */

src.comment:
/**
 * The address or URL of the a media resource that is to be considered.
 */

step.comment:
/**
 * Defines an increment or jump between values that you want to allow the user to enter. When used with the max and min attributes, lets you control the range and increment (for example, allow only even numbers) that the user can enter into an input field.
 */

type.comment:
/**
 * Returns the content type of the object.
 */

defaultValue.comment:
/**
 * Sets or retrieves the initial contents of the object.
 */

value.comment:
/**
 * Returns the value of the data at the cursor's current position.
 */

valueAsDate.comment:
/**
 * Returns a Date object representing the form control's value, if applicable; otherwise, returns null. Can be set, to change the value. Throws an "InvalidStateError" DOMException if the control isn't date- or time-based.
 */

valueAsNumber.comment:
/**
 * Returns the input field value as a number.
 */

width.comment:
/**
 * Sets or retrieves the width of the object.
 */

willValidate.comment:
/**
 * Returns whether an element will successfully validate based on forms validation rules and constraints.
 */

validity.comment:
/**
 * Returns a  ValidityState object that represents the validity states of an element.
 */

validationMessage.comment:
/**
 * Returns the error message that would be displayed if the user submits the form, or an empty string if no error message. It also triggers the standard error message, such as "this is a required field". The result is that the user sees validation messages without actually submitting.
 */

selectionStart.comment:
/**
 * Gets or sets the starting position or offset of a text selection.
 */

selectionEnd.comment:
/**
 * Gets or sets the end position or offset of a text selection.
 */

align.comment:
/**
 * Sets or retrieves how the object is aligned with adjacent text.
 */

useMap.comment:
/**
 * Sets or retrieves the URL, often with a bookmark extension (#name), to use as a client-side image map.
 */

target.comment:
/**
 * Sets or retrieves the window or frame at which to target content.
 */

rel.comment:
/**
 * Sets or retrieves the relationship between the object and the destination of the link.
 */

hreflang.comment:
/**
 * Sets or retrieves the language code of the object.
 */

text.comment:
/**
 * Retrieves or sets the text of the object as a string.
 */

coords.comment:
/**
 * Sets or retrieves the coordinates of the object.
 */

charset.comment:
/**
 * Sets or retrieves the character set used to encode the object.
 */

name.comment:
/**
 * Sets or retrieves the shape of the object.
 */

rev.comment:
/**
 * Sets or retrieves the relationship between the object and the destination of the link.
 */

shape.comment:
/**
 * Sets or retrieves the shape of the object.
 */

name.comment:
/**
 * Sets or retrieves the name of an input parameter for an element.
 */

value.comment:
/**
 * Sets or retrieves the value of an input parameter for an element.
 */

type.comment:
/**
 * Sets or retrieves the content type of the resource designated by the value attribute.
 */

valueType.comment:
/**
 * Sets or retrieves the data type of the value attribute.
 */

width.comment:
/**
 * Sets or gets a value that you can use to implement your own width functionality for the object.
 */

item.comment:
/**
 * Returns the token with index index.
 */

contains.comment:
/**
 * Returns true if token is present, and false otherwise.
 */

replace.comment:
/**
 * Removes the current page from the session history and navigates to the given URL.
 */

origin.comment:
/**
 * Returns the Location object's URL's origin.
 */

ancestorOrigins.comment:
/**
 * Returns a DOMStringList object listing the origins of the ancestor browsing contexts, from the parent browsing context to the top-level browsing context.
 */

advance.comment:
/**
 * Advances the cursor through the next count records in range.
 */

continue.comment:
/**
 * Advances the cursor to the next record in range.
 */

continuePrimaryKey.comment:
/**
 * Advances the cursor to the next record in range matching or after key and primaryKey. Throws an "InvalidAccessError" DOMException if the source is not an index.
 */

source.comment:
/**
 * Returns the IDBObjectStore or IDBIndex the cursor was opened from.
 */

direction.comment:
/**
 * Returns the direction ("next", "nextunique", "prev" or "prevunique") of the cursor.
 */

key.comment:
/**
 * Returns the key of the cursor. Throws a "InvalidStateError" DOMException if the cursor is advancing or is finished.
 */

primaryKey.comment:
/**
 * Returns the effective key of the cursor. Throws a "InvalidStateError" DOMException if the cursor is advancing or is finished.
 */

suffixes.comment:
/**
 * Returns the MIME type's typical file extensions, in a comma-separated list.
 */

enabledPlugin.comment:
/**
 * Returns the Plugin object that implements this MIME type.
 */

face.comment:
/**
 * Sets or retrieves the current typeface family.
 */

size.comment:
/**
 * Sets or retrieves the font size of the object.
 */

remove.comment:
/**
 * Removes the item with index index from the collection.
 */

getAsString.comment:
/**
 * Invokes the callback with the string data as the argument, if the drag data item kind is Plain Unicode string.
 */

getAsFile.comment:
/**
 * Returns a File object, if the drag data item kind is File.
 */

kind.comment:
/**
 * Returns the drag data item kind, one of: "string", "file".
 */

type.comment:
/**
 * Returns the drag data item type string.
 */

only.comment:
/**
 * Returns a new IDBKeyRange spanning only key.
 */

lowerBound.comment:
/**
 * Returns a new IDBKeyRange starting at key with no upper bound. If open is true, key is not included in the range.
 */

upperBound.comment:
/**
 * Returns a new IDBKeyRange with no lower bound and ending at key. If open is true, key is not included in the range.
 */

bound.comment:
/**
 * Returns a new IDBKeyRange spanning from lower to upper. If lowerOpen is true, lower is not included in the range. If upperOpen is true, upper is not included in the range.
 */

includes.comment:
/**
 * Returns true if key is included in the range, and false otherwise.
 */

lower.comment:
/**
 * Returns lower bound, or undefined if none.
 */

upper.comment:
/**
 * Returns upper bound, or undefined if none.
 */

lowerOpen.comment:
/**
 * Returns true if the lower open flag is set, and false otherwise.
 */

upperOpen.comment:
/**
 * Returns true if the upper open flag is set, and false otherwise.
 */

encode.comment:
/**
 * Returns the result of running UTF-8's encoder.
 */

encodeInto.comment:
/**
 * Runs the UTF-8 encoder on source, stores the result of that operation into destination, and returns the progress made as a dictionary whereby read is the number of converted code units of source and written is the number of bytes modified in destination.
 */

align.comment:
/**
 * Sets or retrieves a value that indicates the table alignment.
 */

submit.comment:
/**
 * Fires when a FORM is about to be submitted.
 */

reset.comment:
/**
 * Fires when the user resets a form.
 */

checkValidity.comment:
/**
 * Returns whether a form will validate when it is submitted, without having to submit it.
 */

acceptCharset.comment:
/**
 * Sets or retrieves a list of character encodings for input data that must be accepted by the server processing the form.
 */

action.comment:
/**
 * Sets or retrieves the URL to which the form content is sent for processing.
 */

autocomplete.comment:
/**
 * Specifies whether autocomplete is applied to an editable text field.
 */

enctype.comment:
/**
 * Sets or retrieves the encoding type for the form.
 */

encoding.comment:
/**
 * Sets or retrieves the MIME encoding for the form.
 */

method.comment:
/**
 * Sets or retrieves how to send the form data to the server.
 */

name.comment:
/**
 * Sets or retrieves the name of the object.
 */

noValidate.comment:
/**
 * Designates a form that is not validated when submitted.
 */

target.comment:
/**
 * Sets or retrieves the window or frame at which to target content.
 */

elements.comment:
/**
 * Retrieves a collection, in source order, of all controls in a given form.
 */

length.comment:
/**
 * Sets or retrieves the number of objects in a collection.
 */

checkValidity.comment:
/**
 * Returns whether a form will validate when it is submitted, without having to submit it.
 */

form.comment:
/**
 * Retrieves a reference to the form that the object is embedded in.
 */

willValidate.comment:
/**
 * Returns whether an element will successfully validate based on forms validation rules and constraints.
 */

validity.comment:
/**
 * Returns a  ValidityState object that represents the validity states of an element.
 */

validationMessage.comment:
/**
 * Returns the error message that would be displayed if the user submits the form, or an empty string if no error message. It also triggers the standard error message, such as "this is a required field". The result is that the user sees validation messages without actually submitting.
 */

setTransform.comment:
/**
 * Sets the transformation matrix that will be used when rendering the pattern during a fill or stroke painting operation.
 */

align.comment:
/**
 * Sets or retrieves how the object is aligned with adjacent text.
 */

noShade.comment:
/**
 * Sets or retrieves whether the horizontal rule is drawn with 3-D shading.
 */

width.comment:
/**
 * Sets or retrieves the width of the object.
 */

label.comment:
/**
 * Sets or retrieves a value that you can use to implement your own label functionality for the object.
 */

form.comment:
/**
 * Retrieves a reference to the form that the object is embedded in.
 */

collapsed.comment:
/**
 * Returns true if range is collapsed, and false otherwise.
 */

transferFromImageBitmap.comment:
/**
 * Transfers the underlying bitmap data from imageBitmap to context, and the bitmap becomes the contents of the canvas element to which context is bound.
 */

canvas.comment:
/**
 * Returns the canvas element that the context is bound to.
 */

transferToImageBitmap.comment:
/**
 * Returns a newly created ImageBitmap object with the image in the OffscreenCanvas object. The image in the OffscreenCanvas object is replaced with a new blank image.
 */

width.comment:
/**
 * Returns the intrinsic width of the image, in CSS pixels.
 */

height.comment:
/**
 * Returns the intrinsic height of the image, in CSS pixels.
 */

close.comment:
/**
 * Aborts any instances of the fetch algorithm started for this EventSource object, and sets the readyState attribute to CLOSED.
 */

url.comment:
/**
 * Returns the URL providing the event stream.
 */

withCredentials.comment:
/**
 * Returns true if the credentials mode for connection requests to the URL providing the event stream is set to "include", and false otherwise.
 */

readyState.comment:
/**
 * Returns the state of this EventSource object's connection. It can have the values described below.
 */

append.comment:
/**
 * Appends a specified key/value pair as a new search parameter.
 */

delete.comment:
/**
 * Deletes the given search parameter, and its associated value, from the list of all search parameters.
 */

get.comment:
/**
 * Returns the first value associated to the given search parameter.
 */

getAll.comment:
/**
 * Returns all the values association with a given search parameter.
 */

has.comment:
/**
 * Returns a Boolean indicating if such a search parameter exists.
 */

set.comment:
/**
 * Sets the value associated to a given search parameter to the given value. If there were several values, delete the others.
 */

comment.entries:
/**
 * Returns an array of key, value pairs for every entry in the search params.
 */

comment.keys:
/**
 * Returns a list of keys in the search params.
 */

comment.values:
/**
 * Returns a list of values in the search params.
 */

postMessage.comment:
/**
 * Sends the given message to other BroadcastChannel objects set up for this channel. Messages can be structured objects, e.g. nested objects and arrays.
 */

close.comment:
/**
 * Closes the BroadcastChannel object, opening it up to garbage collection.
 */

name.comment:
/**
 * Returns the channel name (as passed to the constructor).
 */

comment.entries:
/**
 * Returns an array of key, value pairs for every entry in the list.
 */

comment.keys:
/**
 * Returns an list of keys in the list.
 */

comment.values:
/**
 * Returns an list of values in the list.
 */

querySelector.comment:
/**
 * Returns the first element that is a descendant of node that matches selectors.
 */

querySelectorAll.comment:
/**
 * Returns all element descendants of node that match selectors.
 */

firstElementChild.comment:
/**
 * Returns the first child that is an element, and null otherwise.
 */

lastElementChild.comment:
/**
 * Returns the last child that is an element, and null otherwise.
 */

getElementById.comment:
/**
 * Returns the first element within node's descendants whose ID is elementId.
 */

styleSheets.comment:
/**
 * Retrieves a collection of styleSheet objects representing the style sheets that correspond to each instance of a link or style object in the document.
 */

previousElementSibling.comment:
/**
 * Returns the first preceding sibling that is an element, and null otherwise.
 */

nextElementSibling.comment:
/**
 * Returns the first following sibling that is an element, and null otherwise.
 */

fatal.comment:
/**
 * Returns true if error mode is "fatal", and false otherwise.
 */

ignoreBOM.comment:
/**
 * Returns true if ignore BOM flag is set, and false otherwise.
 */

readable.comment:
/**
 * Returns a readable stream whose chunks are strings resulting from running encoding's decoder on the chunks written to writable.
 */
